import "./home.css";
import { motion } from "framer-motion";
import Avatar from "@mui/material/Avatar";
import Profil from "../src/images/profil.jpg";
const Home = () => {
  return (
    <motion.div
      className="home-page"
      intial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
    >
      <Avatar src={Profil} />
    </motion.div>
  );
};
export default Home;
